/* eslint-disable n/no-sync */
import { brotliDecompressSync } from 'node:zlib'

let hook: string | undefined

export const getContent = (): string => {
  if (typeof hook === `undefined`)
    hook = brotliDecompressSync(
      Buffer.from(
        '',
        'base64'
      )
    ).toString()

  return hook
}
